    true,nt"url": null,nt"notes": "The Health Department has developed an inspection
    report and scoring system. After conducting an inspection of the facility, the Health
    Inspector calculates a score based on the violations observed. Violations can fall
    into:high risk category: records specific violations that directly relate to the
    transmission of food borne illnesses, the adulteration of food products and the
    contamination of food-contact surfaces.moderate risk category: records specific
    violations that are of a moderate risk to the public health and safety.low risk
    category: records violations that are low risk or have no immediate risk to the
    public health and safety.The score card that will be issued by the inspector is
    maintained at the food establishment and is available to the public in this dataset.
    Follow the link to get file specifications and the most recent zipped archive.",nt"license_title":
